meshGeo.setAttribute('uv', new THREE.BufferAttribute(mUV, 2));
const mIdx = []; for (const f of D.mf) mIdx.push(f[0], f[1], f[2]);
meshGeo.setIndex(mIdx); 
meshGeo.computeVertexNormals();

// Use basic material as fallback, switch to textured when loaded
const meshMat = new THREE.MeshStandardMaterial({
    color: 0xcccccc,
    roughness: 0.7, 
    metalness: 0.0, 
    side: THREE.DoubleSide
});
texImg.onload = () => { 
    texture.needsUpdate = true; 
    meshMat.map = texture;
    meshMat.needsUpdate = true;
    console.log("Texture applied");
};

const meshObj = new THREE.Mesh(meshGeo, meshMat);
scene.add(meshObj);
console.log("Mesh added to scene");

const cageGeo = new THREE.BufferGeometry(), cPos = new Float32Array(D.cv.length * 3);
for (let i = 0; i < D.cv.length; i++) { 
    cPos[i*3] = D.cv[i][0]; cPos[i*3+1] = D.cv[i][1]; cPos[i*3+2] = D.cv[i][2]; 
}
cageGeo.setAttribute('position', new THREE.BufferAttribute(cPos, 3));
const cIdx = []; for (const f of D.cf) cIdx.push(f[0],f[1],f[1],f[2],f[2],f[0]);
cageGeo.setIndex(cIdx);
const cageWire = new THREE.LineSegments(cageGeo, new THREE.LineBasicMaterial({color: 0xff3333}));
cageWire.visible = false; scene.add(cageWire);

const ptGeo = new THREE.BufferGeometry();
ptGeo.setAttribute('position', new THREE.BufferAttribute(cPos.slice(), 3));
const cagePts = new THREE.Points(ptGeo, new THREE.PointsMaterial({size: 6, color: 0xffff00}));
cagePts.visible = false; scene.add(cagePts);

// Camera targeting mesh center
const targetY = D.center[1];
let frame = 0, speed = 1;
let camDist = 1.5, rotY = 0, rotX = 0.2;
let isDrag = false, prevX = 0, prevY = 0;

function updateMesh(t) {
    const f0 = Math.floor(t) % D.nf, f1 = (f0+1) % D.nf, alpha = t - Math.floor(t);
    const cageNow = [], deltas = [];
    for (let i = 0; i < D.cv.length; i++) {
        cageNow.push([
            D.ck[f0][i][0]*(1-alpha)+D.ck[f1][i][0]*alpha, 
            D.ck[f0][i][1]*(1-alpha)+D.ck[f1][i][1]*alpha, 
            D.ck[f0][i][2]*(1-alpha)+D.ck[f1][i][2]*alpha
        ]);
        deltas.push([cageNow[i][0]-D.cv[i][0], cageNow[i][1]-D.cv[i][1], cageNow[i][2]-D.cv[i][2]]);
    }
    const pos = meshGeo.attributes.position.array;
    for (let i = 0; i < D.mv.length; i++) {
        let dx=0,dy=0,dz=0;
        for (let k=0;k<6;k++) { 
            const ci=D.bi[i][k],w=D.bw[i][k]; 
            dx+=w*deltas[ci][0];dy+=w*deltas[ci][1];dz+=w*deltas[ci][2]; 
        }
        pos[i*3]=origPos[i*3]+dx; pos[i*3+1]=origPos[i*3+1]+dy; pos[i*3+2]=origPos[i*3+2]+dz;
    }
    meshGeo.attributes.position.needsUpdate = true; 
    meshGeo.computeVertexNormals();
    const cp = cageGeo.attributes.position.array, pp = ptGeo.attributes.position.array;
    for (let i = 0; i < D.cv.length; i++) { 
        cp[i*3]=pp[i*3]=cageNow[i][0]; cp[i*3+1]=pp[i*3+1]=cageNow[i][1]; cp[i*3+2]=pp[i*3+2]=cageNow[i][2]; 
    }
    cageGeo.attributes.position.needsUpdate = true; 
    ptGeo.attributes.position.needsUpdate = true;
}

renderer.domElement.addEventListener('mousedown', e => { isDrag = true; prevX = e.clientX; prevY = e.clientY; });
window.addEventListener('mouseup', () => isDrag = false);
renderer.domElement.addEventListener('mousemove', e => {
    if (!isDrag) return;
    rotY += (e.clientX - prevX) * 0.01;
    rotX += (e.clientY - prevY) * 0.01;
    rotX = Math.max(-1.2, Math.min(1.2, rotX));
    prevX = e.clientX; prevY = e.clientY;
});
renderer.domElement.addEventListener('wheel', e => {
    e.preventDefault();
    camDist *= 1 + e.deltaY * 0.001;
    camDist = Math.max(0.3, Math.min(5, camDist));
}, {passive: false});

document.getElementById('showMesh').onchange = e => meshObj.visible = e.target.checked;
document.getElementById('showCage').onchange = e => cageWire.visible = e.target.checked;
document.getElementById('showPts').onchange = e => cagePts.visible = e.target.checked;
document.getElementById('spd').oninput = e => speed = parseFloat(e.target.value);
window.onresize = () => { camera.aspect=innerWidth/innerHeight; camera.updateProjectionMatrix(); renderer.setSize(innerWidth,innerHeight); };

// Hide loading, show UI
document.getElementById('loading').style.display = 'none';
document.getElementById('ui').style.display = 'block';
document.getElementById('bottom').style.display = 'block';

function animate() {
    requestAnimationFrame(animate);
    frame += speed * 0.5;
    updateMesh(frame);
    camera.position.x = Math.sin(rotY) * Math.cos(rotX) * camDist;
    camera.position.y = Math.sin(rotX) * camDist + targetY;
    camera.position.z = Math.cos(rotY) * Math.cos(rotX) * camDist;
    camera.lookAt(0, targetY, 0);
    document.getElementById('info').textContent = (frame % D.nf).toFixed(1);
    renderer.render(scene, camera);
}
console.log("Starting animation");
animate();

} catch(e) {
    document.getElementById('loading').textContent = 'Error: ' + e.message;
    console.error(e);
}
</script></body></html>
